        "name": "cHTML - Video Tracking",
        "type": "html",
        "parameter": [
            {
                "type": "TEMPLATE",
                "key": "html",
                "value": "<script>\n\twindow.dataLayer = window.dataLayer || [];\n\t\n\tvar report25 = false,\n\t\treport50 = false,\n\t\treport75 = false,\n\t\treport99 = false;\n  \n\n\tsetTimeout(function () {\n\t\tvar videos = document.querySelectorAll('video');\n\n\t\tfor (var i = 0; i <= videos.length; i++) {\n\t\t\tvar element = videos[i];\n\t\t\tif (!element) {\n\t\t\t\tcontinue;\n\t\t\t}\n\n\t\t\t//We don't want to re-init if this trigger fires a second time\n\t\t\tif (element.percentPlayed >= 0) {\n\t\t\t\tcontinue;\n\t\t\t}\n\n\t\t\telement.percentPlayed = 0;\n\n\t\t\twindow.dataLayer.push({\n\t\t\t\tevent: 'video_in_viewport',\n\t\t\t\tvideo_action: 'visible',\n\t\t\t\tvideo_url: element.src,\n                page_url: window.location.href\n\t\t\t});\n\n\t\t\telement.addEventListener('timeupdate', trackVideoProgress);\n\t\t}\n\t}, 100);\n\n\tfunction trackVideoProgress(event) {\n\t\tif (!event) {\n\t\t\treturn false;\n\t\t}\n      \n\t\tvar time = event.target.currentTime;\n\t\tvar duration = event.target.duration;\n\t\tvar p = time / duration;\n\t\tvar percentPlayed = Math.min(100, Math.ceil(p * 100));\n\n\t\tif (percentPlayed <= event.target.percentPlayed) {\n\t\t\treturn;\n\t\t}\n\n\t\tif (percentPlayed >= 25 && !report25) {\n\t\t\tpushVideoProgress(25)\n\t\t\treport25 = true;\n\t\t} else if (percentPlayed >= 50 && !report50) {\n\t\t\tpushVideoProgress(50);\n\t\t\treport50 = true;\n\t\t} else if (percentPlayed >= 75 && !report75) {\n\t\t\tpushVideoProgress(75);\n\t\t\treport75 = true;\n\t\t} else if (percentPlayed >= 99 && !report99) {\n\t\t\tpushVideoProgress(99);\n\t\t\treport99 = true;\n\t\t}\n\n\t\tfunction pushVideoProgress(percentage) {\n\t\t\twindow.dataLayer.push({\n\t\t\t\tevent: 'video_progress',\n\t\t\t\tvideo_action: 'progress',\n\t\t\t\tvideo_percent: percentage,\n\t\t\t\tvideo_url: event.target.src,\n                page_url: window.location.href\n\t\t\t});\n\t\t}\n\n\t\tevent.target.percentPlayed = percentPlayed;\n\t}\n</script>"
