                        "value": "function () {\n  /**\n    * helper function to calculate the extended price of all \n    * the items in the cart\n    **/\n  \n  // use the normalized items array just in case\n  var items = {{cJS - eCommerce - items (normalized)}};\n  \n  // Check if items is an array and has at least one\n  if (Array.isArray(items) && items.length > 0) {\n    var sum = 0;\n    for (var i = 0; i < items.length; i++) {\n      var item = items[i];\n      var price = (item.price - item.discount) * item.quantity;\n      sum += price;\n    }\n    \n    var sumFormattedString = sum.toFixed(2);\n    console.log('formattedString');\n    console.log(sumFormattedString);\n    \n    var result = parseFloat(sumFormattedString);\n    console.log('result');\n    console.log(result);\n    return result;\n    return parseFloat(sumFormattedString);\n  }\n\n  return 0;\n}"
