                        "value": "function() {\n  // fetch the cart value\n  var ecomm_value = {{GA4 - Ecommerce - value}};\n  if (ecomm_value === undefined) {\n    return 0;\n  }\n  // fetch the sum of the calculated value of the items in the cart\n  var items_value = {{cJS - eCommerce - calculated items list value}};\n  if (!items_value) {\n    return 0;\n  }\n\n  // when the items_value is greater give back the difference\n  // this should be the coupon discount applied\n  if (items_value > ecomm_value) {\n    //return items_value - ecomm_value;\n\n    var items_cents = items_value * 100;\n    console.log('items cents');\n    console.log(items_cents);\n    var ecomm_cents = ecomm_value * 100;\n    console.log('ecomm cents');\n    console.log(ecomm_cents);\n    var result = items_cents - ecomm_cents;\n    console.log('diff');\n    console.log(result);\n    console.log('====');\n    return result / 100;\n  }\n  \n  // the coupon discount shouldn't be negative ...\n  return 0;\n}"
                    }
