//const logToConsole = require("logToConsole");
const copyFromWindow = require("copyFromWindow");
const injectScript = require("injectScript");
const getUrl = require("getUrl");
const parseUrl = require("parseUrl");
const urlObject = parseUrl(getUrl());
const pathname = urlObject.pathname;
const hash = urlObject.hash;
const getQueryParameters = require("getQueryParameters");
const createQueue = require("createQueue");

const _uxaPush = createQueue("_uxa");
const _uxa = copyFromWindow("_uxa");
const CS_CONF = copyFromWindow("CS_CONF");
const CS_webViewEnabled = copyFromWindow("CS_webViewEnabled");
const CS_isWebView = copyFromWindow("CS_isWebView");

const utm_medium = getQueryParameters("utm_medium");
const utm_source = getQueryParameters("utm_source");
const utm_campaign = getQueryParameters("utm_campaign");
const gclid = getQueryParameters("gclid");

const cvars = data.cvars;
const piiselectors = data.piiselectors;
const attributeselectors = data.attributeselectors;
const tagID = data.TagId;
const webViewTagID = data.WebViewTagId;

if (utm_medium !== "" && typeof utm_medium !== "undefined") {
    _uxaPush([
        "trackDynamicVariable",
        {
            key: "Medium",
            value: utm_medium.toLowerCase(),
        },
    ]);
}

if (utm_source !== "" && typeof utm_source !== "undefined") {
    _uxaPush([
        "trackDynamicVariable",
        {
            key: "Source",
            value: utm_source.toLowerCase(),
        },
    ]);
}

if (utm_campaign !== "" && typeof utm_campaign !== "undefined") {
    _uxaPush([
        "trackDynamicVariable",
        {
            key: "Campaign",
            value: utm_campaign.toLowerCase(),
        },
    ]);
}

if (gclid !== "" && typeof gclid !== "undefined") {
    _uxaPush([
        "trackDynamicVariable",
        {
            key: "Gclid",
            value: "true",
        },
    ]);
}

if (cvars) {
    for (var i = 0; i < cvars.length; i++) {
        const slot = cvars[i].slot;
        const key = cvars[i].name;
        const value = cvars[i].value;
        const getScope = cvars[i].scope;
        let scope;

        //This is for backward compatability to support older tag versions which did not have any scope defined so as to not break.
        //Scope 3 used to be hardcoded so this will keep that logic the same after upgrade.
        if (getScope === "" || typeof getScope === "undefined") {
            scope = 3;
        } else if (getScope === "4n" || getScope === "4an") {
            scope = 4;
        } else {
            scope = getScope;
        }

        if (key != "" && typeof key != "undefined" && value != "" && typeof value != "undefined") {
            if (getScope === 0) {
                _uxaPush(["setCustomVariable", slot, key, value]);
            } else {
                _uxaPush(["setCustomVariable", slot, key, value, scope]);
            }
        }
    }
}

let usePIIapi = false;
let piiObject = {};

if (piiselectors) {
    piiObject.PIISelectors = [piiselectors];
    if (piiObject.PIISelectors) {
        usePIIapi = true;
    }
}

if (attributeselectors) {
    piiObject.Attributes = [];
    for (var i = 0; i < attributeselectors.length; i++) {
        piiObject.Attributes.push({
            selector: attributeselectors[i].selectors,
            attrName: attributeselectors[i].attributes,
        });
    }

    if (piiObject.Attributes.length) {
        usePIIapi = true;
    }
}

if (usePIIapi) {
    _uxaPush(["setPIISelectors", piiObject]);
}

function onSuccess() {
    data.gtmOnSuccess();
}

function onFailure() {
    data.gtmOnFailure();
}

if (typeof CS_CONF === "undefined") {
    _uxaPush(["setPath", pathname + hash.replace("#", "?__")]);    

    let tagToInject = tagID;

    if ((!!CS_webViewEnabled || !!CS_isWebView) && !!webViewTagID) {
        tagToInject = webViewTagID;
        _uxaPush(["setOption", "isWebView", true]);
    }

    if (tagToInject) {
        injectScript("https://t.contentsquare.net/uxa/" + tagToInject + ".js", onSuccess, onFailure);
    }
} else {
     _uxaPush(["trackPageview", pathname + hash.replace("#", "?__")]);

     data.gtmOnSuccess();
}


