const log = require('logToConsole');
const getCookieValues = require('getCookieValues');
const setDefaultConsentState = require('setDefaultConsentState');
const updateConsentState = require('updateConsentState');

let cookieStr = getCookieValues('OptanonConsent');
//log('consent cookie = ', cookieStr);

// Process default consent state
data.settingsTable.forEach(setting => {
  const settingObject = {
    ad_storage: setting.ad_storage,
    analytics_storage: setting.analytics_storage,
    functionality_storage: setting.functionality_storage,
    personalization_storage: setting.personalization_storage,
    security_storage: setting.security_storage,
    wait_for_update: setting.wait_for_update
  };
  if (setting.regions !== 'all') {
    settingObject.region = setting.regions.split(',').map(r => r.trim());
  }
  setDefaultConsentState(settingObject);
});

//parse OneTrust cookie to obtain consent state as consent update
//from OneTrust was firing post-container loaded
let cookieArr = cookieStr[0].split("&");
//log("cookieArr = ", cookieArr);
let match = "";
const CONSENT = {
  'ad_storage': 'denied',
  'analytics_storage': 'denied',
  'functionality_storage': 'denied',
  'personalization_storage': 'denied',
  'security_storage': 'granted'
};

for (let i = 0; i < cookieArr.length; i++) {
  if (cookieArr[i].indexOf("groups=") >= 0)
    match = cookieArr[i].slice(7);
}
//log("match = ", match);

if (match) {
  let groups = match.split(',');
  groups.forEach(function(el) {
    let vals = el.split(':');

    switch (vals[0]) {
      case 'C0001':
        CONSENT.security_storage = vals[1] > 0 ? 'granted' : 'denied';
        break;
      case 'C0002':
        CONSENT.analytics_storage = vals[1] > 0 ? 'granted' : 'denied';
        break;
      case 'C0003':
        CONSENT.functionality_storage = vals[1] > 0 ? 'granted' : 'denied';
        CONSENT.personalization_storage = vals[1] > 0 ? 'granted' : 'denied';
        break;
      case 'C0004':
        CONSENT.ad_storage = vals[1] > 0 ? 'granted' : 'denied';
        break;
    }
  });
  //log(CONSENT);
  updateConsentState(CONSENT);
  data.gtmOnSuccess();
}
else
{
  data.gtmOnFailure();
}


